import axios from 'axios';

export function consumeApi() {
    return (dispatch) => {
        return axios.post(`http://localhost:7000`)
            .then(response => {
                dispatch({
                    type: 'CONSUME_API_POST',
                    payload: response.data
                })
            })
            .catch(error => {
                throw (error);
            });
    }
}

export function consumeApiPut() {
    return (dispatch) => {
        return axios.put(`http://localhost:7000/user`)
            .then(response => {
                dispatch({
                    type: 'CONSUME_API_POST',
                    payload: response.data
                })
            })
            .catch(error => {
                throw (error);
            });
    }
}
